import React from 'react';
import Card from './Card';
import Fdata from './Fdata';
const Service = () => {
    return (
        <>
            <div className="my-5">
                <h1 className="text-center">Our services</h1>
            </div>

            <div className="container-fluid mb-5">
                <div className="row ">
                    <div className="col-10 mx-auto">
                       {
                           Fdata.map((val,index)=>{
                              return <Card 
                                imgsrc={val.imgsrc}
                                title={val.title}
                              />
                           })
                       }
                    </div>
                </div>
            </div>
        </>
    )
}

export default Service;
